// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import "./IHederaTokenService.sol";
import "./TokenAuthority.sol";

contract CommodityExchange {
    address public admin;
    TokenAuthority public tokenAuthority;

    struct Commodity {
        address tokenAddress;
        address producer;
        int64 quantity;
        uint256 price;
        uint256 deliveryWindow;
        bool isActive;
    }

    mapping(uint256 => Commodity) public commodities;
    uint256 public commodityCount;

    mapping(address => bool) public approvedCommodityTokens;

    event CommodityListed(uint256 indexed commodityId, address indexed tokenAddress, address indexed producer, int64 quantity, uint256 price, uint256 deliveryWindow);
    event CommodityTokenApproved(address indexed tokenAddress);
    event CommodityTokenRemoved(address indexed tokenAddress);

    constructor(address _tokenAuthority) {
        tokenAuthority = TokenAuthority(_tokenAuthority);
        admin = msg.sender;
    }

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier onlyTokenAuthority() {
        require(msg.sender == address(tokenAuthority), "Only TokenAuthority can perform this action");
        _;
    }

    function approveCommodityToken(address tokenAddress) external onlyAdmin {
        approvedCommodityTokens[tokenAddress] = true;
        emit CommodityTokenApproved(tokenAddress);
    }

    function removeCommodityToken(address tokenAddress) external onlyAdmin {
        approvedCommodityTokens[tokenAddress] = false;
        emit CommodityTokenRemoved(tokenAddress);
    }

    function listCommodity(address tokenAddress, int64 quantity, uint256 price, uint256 deliveryWindow) external {
        require(quantity > 0, "Quantity must be greater than zero");
        require(price > 0, "Price must be greater than zero");
        require(deliveryWindow > block.timestamp, "Delivery window must be in the future");

        // Request token minting
        int64 responseCode = tokenAuthority.requestMinting(tokenAddress, quantity, deliveryWindow, msg.sender);
        require(responseCode == 0, "Token minting failed");

        // check if tokenAddress is approved
        require(approvedCommodityTokens[tokenAddress], "Token not approved for listing");

        uint256 commodityId = commodityCount;
        commodityCount++;

        commodities[commodityId] = Commodity({
            tokenAddress: tokenAddress,
            producer: msg.sender,
            quantity: quantity,
            price: price,
            deliveryWindow: deliveryWindow,
            isActive: true
        });

        emit CommodityListed(commodityId, tokenAddress, msg.sender, quantity, price, deliveryWindow);
    }

    function getCommodity(uint256 commodityId) public view returns (Commodity memory) {
        require(commodityId < commodityCount, "Commodity does not exist");
        return commodities[commodityId];
    }

    function getCommodities() public view returns (Commodity[] memory) {
        Commodity[] memory result = new Commodity[](commodityCount - 1);
        for (uint256 i = 1; i < commodityCount; i++) {
            result[i - 1] = commodities[i];
        }
        return result;
    }
}

contracts/IHederaTokenService.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;
pragma experimental ABIEncoderV2;

interface IHederaTokenService {
    struct Expiry {
        uint32 second;
        uint32 autoRenewPeriod;
    }

    struct HederaToken {
        string name;
        string symbol;
        address treasury;
        string memo;
        bool supplyType;
        uint32 maxSupply;
        bool freezeDefault;
        Expiry expiry;
    }

    struct TokenKey {
        uint256 keyType;
        bytes key;
    }

    function createFungibleToken(
        HederaToken memory token,
        uint64 initialTotalSupply,
        uint32 decimals,
        TokenKey[] memory keys
    ) external payable returns (int64 responseCode, address tokenAddress);

    function mintToken(
        address token,
        int64 amount,
        bytes[] memory metadata
    ) external returns (int64 responseCode, uint64 newTotalSupply, int64[] memory serialNumbers);

    function transferToken(
        address token,
        address sender,
        address recipient,
        int64 amount
    ) external returns (int64 responseCode);

    function transferNFT(
        address token,
        address sender,
        address recipient,
        int64 serialNumber
    ) external returns (int64 responseCode);

    function associateToken(
        address account,
        address token
    ) external returns (int64 responseCode);
}

